import React, { useState } from "react";
import axios from "axios";

function RegisterForm({ onSuccess, onClose }) {
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  async function handleSubmit(e) {
    e.preventDefault();
    setError("");

    if (password !== confirmPassword) {
      setError("Şifreler eşleşmiyor.");
      return;
    }

    setLoading(true);
    try {
      const API_BASE_URL = localStorage.getItem("API_BASE_URL") || "http://localhost:5043";
      const response = await axios.post(`${API_BASE_URL}/api/User/Register`, {
        username,
        email,
        password,
      });

      const { token, user } = response.data;
      localStorage.setItem("jwt", token);
      localStorage.setItem("token", token);

      const userData = {
        userId: user?.userId || user?.id || 1,
        username: user?.username || user?.email || username,
        email: user?.email || email,
      };

      if (onSuccess) onSuccess(userData);
    } catch (err) {
      setError(
        err?.response?.data?.message || "Kayıt başarısız. Lütfen tekrar deneyin."
      );
    } finally {
      setLoading(false);
    }
  }

  return (
    <div
      style={{
        position: "fixed",
        top: 0,
        left: 0,
        width: "100vw",
        height: "100vh",
        background: "rgba(0,0,0,0.4)",
        zIndex: 2000,
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
      onClick={onClose}
    >
      <div
        style={{
          background: "var(--modal-bg)",
          color: "var(--text-primary)",
          borderRadius: 16,
          padding: 32,
          maxWidth: 400,
          width: "100%",
          position: "relative",
        }}
        onClick={(e) => e.stopPropagation()}
      >
        <button
          onClick={onClose}
          style={{
            position: "absolute",
            top: 16,
            right: 16,
            background: "var(--accent-color)",
            color: "#fff",
            border: "none",
            borderRadius: 8,
            padding: "4px 12px",
            fontSize: 18,
            cursor: "pointer",
          }}
        >
          Kapat
        </button>
        <h2 style={{ marginBottom: 24 }}>Üye Ol
        </h2>
        <form onSubmit={handleSubmit}>
          <div style={{ marginBottom: 16 }}>
            <label htmlFor="register-username">Kullanıcı Adı</label>
            <input
              id="register-username"
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              required
              style={{ width: "100%", padding: 8, borderRadius: 6 }}
            />
          </div>
          <div style={{ marginBottom: 16 }}>
            <label htmlFor="register-email">E-posta</label>
            <input
              id="register-email"
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              style={{ width: "100%", padding: 8, borderRadius: 6 }}
            />
          </div>
          <div style={{ marginBottom: 16 }}>
            <label htmlFor="register-password">Şifre</label>
            <input
              id="register-password"
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              style={{ width: "100%", padding: 8, borderRadius: 6 }}
            />
          </div>
          <div style={{ marginBottom: 16 }}>
            <label htmlFor="register-confirm-password">Şifre Tekrarı</label>
            <input
              id="register-confirm-password"
              type="password"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              required
              style={{ width: "100%", padding: 8, borderRadius: 6 }}
            />
          </div>
          {error && <div style={{ color: "red", marginBottom: 12 }}>{error}</div>}
          <button
            type="submit"
            disabled={!username || !email || !password || !confirmPassword || loading}
            style={{ width: "100%", padding: 10, borderRadius: 8, background: "var(--accent-color)", color: "#fff" }}
          >
            {loading ? "Üye Olunuyor..." : "Üye Ol"}
          </button>
        </form>
      </div>
    </div>
  );
}

export default RegisterForm;
